import React , {useEffect, useState}from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import Slide from '@material-ui/core/Slide';
import AccountTemplate from './Template/accountTemplate';
import AddAccountTemplate from './Template/addAccountTemplate';
import axios from "axios";

const useStyles = makeStyles((theme) => ({
  appBar: {
    position: 'relative',
  },
  title: {
    marginLeft: theme.spacing(2),
    flex: 1,
  },
}));

const Transition = React.forwardRef(function Transition(props, ref) {
  return <Slide direction="up" ref={ref} {...props} />;
});

const api = {
  url: "https://dev.geo.sdis67.com/api/v1/public/allUsers"
};
export default function DashBoard(props) {
  const [ApiData, setApiData]= useState(null)
  const classes = useStyles();
  const [openAccount, setOpenAccount] = React.useState(false);
  const [openAddAccount, setOpenAddAccount] = React.useState(false);
  const handleClickOpenAccount = () => {
    setOpenAccount(true);
  };
  const getAPIData = async () => {
    const res = await axios.get(`${api.url}?group=maire`);
    setApiData(res.data)
  };
  useEffect(() => {
    console.log("getapi");
    getAPIData();
  }, []);
  console.warn("debugApiData", ApiData);
  const handleClickOpenAddAccount = () => {
    setOpenAddAccount(true);
  };
  const handleClose = () => {
    setOpenAccount(false);
    setOpenAddAccount(false);
  };
  const account = (
    <AccountTemplate apiData= {ApiData}/>
  );
  const addAcount = (
    <AddAccountTemplate apiData= {ApiData}/>
  );
  return (
    <div>
      <Button variant="outlined" color="primary" onClick={handleClickOpenAccount}>
        Modifier le profil
      </Button>
      <Button variant="outlined" color="primary" onClick={handleClickOpenAddAccount}>
        Ajouter un profil
      </Button>
      <Dialog fullScreen open={openAccount} onClose={handleClose} TransitionComponent={Transition}>
        <AppBar className={classes.appBar}>
          <Toolbar>
            <IconButton edge="start" color="inherit" onClick={handleClose} aria-label="close">
              <CloseIcon />
            </IconButton>
            <Button autoFocus color="inherit" onClick={handleClose}>
              save
            </Button>
          </Toolbar>
        </AppBar>
        {account}
      </Dialog>
      <Dialog fullScreen open={openAddAccount} onClose={handleClose} TransitionComponent={Transition}>
        <AppBar className={classes.appBar}>
          <Toolbar>
            <IconButton edge="start" color="inherit" onClick={handleClose} aria-label="close">
              <CloseIcon />
            </IconButton>
            <Button autoFocus color="inherit" onClick={handleClose}>
              save
            </Button>
          </Toolbar>
        </AppBar>
        {addAcount}
      </Dialog>
    </div>
  );
}
